"atom"],"en",["^ ","^3","atom","^4",["^ ","^15","Typically, higher income countries have higher price levels, while lower income countries have lower price levels (Balassa-Samuelson effect). Market exchange rate-based cross-country comparisons of GDP at its expenditure components reflect both differences in economic outputs (volumes) and prices. Given the differences in price levels, the size of higher income countries is inflated, while the size of lower income countries is depressed in the comparison. PPP-based cross-country comparisons of GDP at its expenditure components only reflect differences in economic outputs (volume), as PPPs control for price level differences between the countries. Hence, the comparison reflects the real size of the countries.\n\nFor more information on underlying GDP in current international dollar, please refer to the metadata for \"GDP, PPP (current international $)\" [NY.GDP.MKTP.PP.CD].\nFor more information on underlying population, please refer to the metadata for \"total population” [SP.POP.TOTL]. \nFor the concept and methodology of PPP, please refer to the International Comparison Program (ICP)’s website (https://www.worldbank.org/en/programs/icp).","^16","Weighted average","^18","Annual","^19","Economic Policy & Debt: Purchasing power parity","^1:","International Comparison Program, World Bank | World Development Indicators database, World Bank | Eurostat-OECD PPP Programme.","^1;","This indicator provides per capita values for gross domestic product (GDP) expressed in current international dollars converted by purchasing power parity (PPP) conversion factor. \n\nGDP is the sum of gross value added by all resident producers in the country plus any product taxes and minus any subsidies not included in the value of the products. conversion factor is a spatial price deflator and currency converter that controls for price level differences between countries. Total population is a mid-year population based on the de facto definition of population, which counts all residents regardless of legal status or citizenship.","^11","https://datacatalog.worldbank.org/public-licenses#cc-by","^1<","This indicator provides per capita values for gross domestic product (GDP) expressed in current international dollars converted by purchasing power parity (PPP) conversion factor. \n\nGDP is the sum of gross value added by all resident producers in the country plus any product taxes and minus any subsidies not included in the value of the products. conversion factor is a spatial price deflator and currency converter that controls for price level differences between countries. Total population is a mid-year population based on the de facto definition of population, which counts all residents regardless of legal status or citizenship.","^10","CC BY-4.0","^1=","GDP per capita, PPP (current international $)","^1>","International Comparison Program, World Bank | World Development Indicators database, World Bank | Eurostat-OECD PPP Programme.","^1?","GDP per capita, PPP","^1@","GDP per capita, PPP (current international $)"]],"^1=",["^ ","^3","atom","^4","GDP per capita, PPP (current international $)"],"id",["^ ","^3","atom","^4","NY.GDP.PCAP.PP.CD"],"^1A",["^ ","^3","atom","^4",[2023,["KG","CR","NA","MY","DE","SE","KW","CZ","LY","PG","AR","CW","CD","IN","RW","NG","LT","SN","KM","DM","BI","MT","OM","BW","ME","AT","BO","PS","NE","PH","AO","GE","CA","MG","TM","GD","NP","SB","RO","MH","BN","JP","HR","LU","UA","GT","EE","ZT","SG","TL","AZ","SV","VU","PL","KE","XK","GH","CN","AL","LV","AU","KH","UY","KN","T4","MO","BF","ST","TD","MV","IL","BH","NZ","JO","AM","IE","UZ","ZW","PY","MD","GR","ID","MA","T7","CF","SD","CO","T2","QA","LS","PR","LC","ZM","GN","FJ","BD","VN","DJ","IR","NR","SX","GY","SI","GB","BR","RS","HN","ES","SK","BA","GW","KY","AD","JM","NI","MW","TJ","FI","PK","CY","LA","DZ","BY","BG","T5","BE","TT","HK","PW","ML","MX","ET","MR","CM","IQ","FO","SA","CL","BM","SO","PE","KI","TG","NL","AW","AF","CH","CG","VC "BS","TH","TV","MM","GA","HT","PA","T3","CI","MC","FR","RU","TR","NO","AG","FM","BZ","BJ","US","UG","EG","HU","KR","SZ","MZ","DK","AE","WS","MK","MN","IS","IT","LK","DO","ZA","XG"]]],"^1B",["^ ","^3","atom","^4",["NY.GDP.DEFL.KD.ZG.AD","NY.GDP.DEFL.ZS.AD","NY.GDP.DEFL.ZS","NY.GDP.PCAP.KD.ZG","NY.GDP.PETR.RT.ZS","NY.GDP.MKTP.CD","NY.GDP.FCST.CD","NY.GDP.FCST.CN","NY.GDP.MKTP.KD.ZG"]],"^1?",["^ ","^3","atom","^4","Inflation, GDP deflator"],"^1C",["^ ","^3","atom","^4","2"],"^1<",["^ ","^3","atom","^4","Inflation as measured by the annual growth rate of the GDP implicit deflator shows the rate of price change in the economy as a whole. The GDP implicit deflator is the ratio of GDP in current local currency to GDP in constant local currency."],"^1>",["^ ","^3","atom","^4","World Bank national accounts data, and OECD National Accounts data files."],"^1D",["^ ","^3","atom"],"^1E",["^ ","^3","atom","^4",[["^ ","id","3","^4","Economy & Growth"]]],"^1F",["^ ","^3","atom","^4","percent"]],"NY.GDP.PETR.RT.ZS",["^ ","^10",["^ ","^3","atom","^4","CC BY-4.0"],"^11",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^12",["^ ","^3","atom","^4","3.14"],"^13",["^ ","^3","atom","^4",1],"^14",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^19","Environment: Natural resources contribution to GDP","^15","The estimates of natural resources rents are calculated as the difference between the price of a commodity and the average cost of producing it. This is done by estimating the price of units of specific commodities and subtracting estimates of average unit costs of extraction or harvesting costs. These unit rents are then multiplied by the physical quantities countries extract or harvest to determine the rents for each commodity as a share of gross domestic product (GDP).","^16","Weighted average","^18","Annual","Developmentrelevance","Accounting for the contribution of natural resources to economic output is important in building an analytical framework for sustainable development. In some countries earnings from natural resources, especially from fossil fuels and minerals, account for a sizable share of GDP, and much of these earnings come in the form of economic rents - revenues above the cost of extracting the resources.\n\nNatural resources give rise to economic rents because they are not produced. For produced goods and services competitive forces expand supply until economic profits are driven to zero, but natural resources in fixed supply often command returns well in excess of their cost of production. Rents from nonrenewable resources - fossil fuels and minerals - as well as rents from overharvesting of forests indicate the liquidation of a country's capital stock. When countries use such rents to support current consumption rather than to invest in new capital to replace what is being used up, they are, in effect, borrowing against their future.","^1:","World Bank staff estimates based on sources and methods described in the World Bank's The Changing Wealth of Nations.","^1;","Oil rents are the difference between the value of crude oil production at regional prices and total costs of production.","^11","https://datacatalog.worldbank.org/public-licenses#cc-by","^1<","Oil rents are the difference between the value of crude oil production at regional prices and total costs of production.","^10","CC BY-4.0","^1=","Oil rents (% of GDP)","^1>","World Bank staff estimates based on sources and methods described in the World Bank's The Changing Wealth of Nations.","^1?","Oil rents","^1@","Oil rents (% of GDP)"]],"^1=",["^ ","^3","atom","^4","Oil rents (% of GDP)"],"id",["^ ","^3","atom","^4","NY.GDP.PETR.RT.ZS"],"^1A",["^ ","^3","atom","^4",[2021,["KG","CR","NA","MY","DE","SE","BT","CZ","LY","PG","AR","AS","CD","IN","RW","NG","LT","SN","KM","DM","BI","MT","OM","BW","ME","AT","BO","PS","NE","PH","AO","GE","CA","MG","GD","NP","SB","RO","BN","JP","HR","LU","UA","GT","EE","ZT","SG","TL","AZ","SV","VU","PL","KE","XK","GH","CN","AL","LV","AU","KH","UY","KN","T4","MO","BF","ST","TD","MV","IL","BH","NZ","JO","AM","IE","UZ","ZW","PY","MD","GR","ID","MA","T7","CF","LB","SD","CO","T2","QA","LS","PR","LC","ZM","GU","GN","FJ","BD","VN","DJ","IR","NR","GY","SI","GB","BR","RS","HN","ES","SK","BA","GW","KY","JM","NI","MW","TJ","FI","PK","CY","LA","DZ","BY","TO","BG","T5","BE","TT","HK","ML","MX","ET","MR","CM","IQ","FO","SA","CL","BM","SO","PE","KI","TG","NL","AW","AF","CH","CG","NC","VC","KZ","MU","LR","CV","PT","TN","SC","GM","T6","EC","TZ","TC","BB","SL","GQ","SR","BS","TH","PF","MM","GA","HT","PA","T3","CI","FR","RU","TR","NO","AG","BZ","BJ","US","UG","EG","HU","KR","SZ","MZ","DK","AE","WS","MK","MN","IS","IT","LK","DO","ZA","XG"]]],"^1B",["^ ","^3","atom","^4",["NY.GDP.PCAP.KD.ZG","NY.GDP.DEFL.KD.ZG","NY.GDP.MKTP.CD","NY.GDP.FCST.CD","NY.GDP.FCST.CN","NY.GDP.MKTP.KD.ZG","NY.GDP.PCAP.KN","NY.GDP.PCAP.KD","NY.GDP.PCAP.PP.CD"]],"^1?",["^ ","^3","atom","^4","Oil rents"],"^1C",["^ ","^3","atom","^4","2"],"^1<",["^ ","^3","atom","^4","Oil rents are the difference between the value of crude oil production at regional prices and total costs of production."],"^1>",["^ ","^3","atom","^4","World Bank staff estimates based on sources and methods described in the World Bank's The Changing Wealth of Nations."],"^1D",["^ ","^3","atom"],"^1E",["^ ","^3","atom","^4",[["^ ","id","5","^4","Energy & Mining "],["^ ","id","6","^4","Environment "]]],"^1F",["^ ","^3","atom","^4","percent"]],"NY.GDP.MKTP.CD",["^ ","^10",["^ ","^3","atom","^4","CC BY-4.0"],"^11",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^12",["^ ","^3","atom","^4","4.2"],"^13",["^ ","^3","atom","^4",0],"^14",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^15","Gross domestic product (GDP) represents the sum of value added by all its producers. Value added is the value of the gross output of producers less the value of intermediate goods and services consumed in production, before accounting for consumption of fixed capital in production. The United Nations System of National Accounts calls for value added to be valued at either basic prices (excluding net taxes on products) or producer prices (including net taxes on products paid by producers but excluding sales or value added taxes). Both valuations exclude transport charges that are invoiced separately by producers. Total GDP is measured at purchaser prices. Value added by industry is normally measured at basic prices.","^16","Gap-filled total","^18","Annual","^19","Economic Policy & Debt: National accounts: US$ at current prices: Aggregate indicators","^1:","World Bank national accounts data, and OECD National Accounts data files.","^1;","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current U.S. dollars. Dollar figures for GDP are converted from domestic currencies using single year official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used.","^11","https://datacatalog.worldbank.org/public-licenses#cc-by","^1<","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current U.S. dollars. Dollar figures for GDP are converted from domestic currencies using single year official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used.","^10","CC BY-4.0","Limitationsandexceptions","Gross domestic product (GDP), though widely tracked, may not always be the most relevant summary of aggregated economic performance for all economies, especially when production occurs at the expense of consuming capital stock.\n\nWhile GDP estimates based on the production approach are generally more reliable than estimates compiled from the income or expenditure side, different countries use different definitions, methods, and reporting standards. World Bank staff review the quality of national accounts data and sometimes make adjustments to improve consistency with international guidelines. Nevertheless, significant discrepancies remain between international standards and actual practice. Many statistical offices, especially those in developing countries, face severe limitations in the resources, time, training, and budgets required to produce reliable and comprehensive series of national accounts statistics.\n\nAmong the difficulties faced by compilers of national accounts is the extent of unreported economic activity in the informal or secondary economy. In developing countries a large share of agricultural output is either not exchanged (because it is consumed within the household) or not exchanged for money.","^1=","GDP (current US$)","^1>","World Bank national accounts data, and OECD National Accounts data files.","^1?","GDP","^1@","GDP (current US$)"]],"^1=",["^ ","^3","atom","^4","GDP (current US$)"],"id",["^ ","^3","atom","^4","NY.GDP.MKTP.CD"],"^1A",["^ ","^3","atom","^4",[2023,["KG","CR","NA","MY","DE","SE","KW","CZ","LY","PG","AR","CW","CD","IN","RW","NG","LT","SN","KM","DM","BI","MT","OM","BW","ME","AT","BO","PS","NE","PH","AO","JG","GE","CA","MG","TM","GD","NP","SB","RO","MH","BN","JP","HR","LU","UA","GT","EE","ZT","SG","TL","AZ","SV","VU","PL","KE","XK","GH","CN","AL","LV","AU","KH","UY","KN","T4","MO","BF","ST","TD","MV","I
